B1RunAction::~B1RunAction() {}

void B1RunAction::BeginOfRunAction(const G4Run *run)
{
  
  auto analysisManager = G4AnalysisManager::Instance();

  analysisManager->SetNtupleMerging(true);

  fRunID = run->GetRunID();

  analysisManager->SetFileName("1e7_deuterons_2_8MeV_biasingTiT_1e3_detector_2cm_2_983cm.root");

  analysisManager->OpenFile();

  G4RunManager::GetRunManager()->SetRandomNumberStore(false);

  G4AccumulableManager *accumulableManager = G4AccumulableManager::Instance();
  accumulableManager->Reset();
}

void B1RunAction::EndOfRunAction(const G4Run *run) 
{
  G4int nofEvents = run->GetNumberOfEvent();
  if (nofEvents == 0) {return;}

  if (IsMaster())
  {
    G4cout
        << G4endl
        << "--------------------End of Global Run-----------------------";
  }
  else
  {
    G4cout
        << G4endl
        << "--------------------End of Local Run------------------------";
  }
  if (IsMaster()) {G4cout << "NUMBER OF MASTER NEUTRONS" << Nofneutrons << G4endl;}

  auto analysisManager = G4GenericAnalysisManager::Instance();      
       analysisManager->Write();

  if (IsMaster())
    WriteToASCII();
  {analysisManager->CloseFile();}
}

